import React from 'react';
import { useParams } from 'react-router-dom';

const IdeaIndividual = () => {
  let {ideaID} = useParams();

  return (
    <div className='container'>
      <h1>Parametro pasado: {ideaID}</h1>
    </div>
  )
}

export default IdeaIndividual
